import React, { useEffect, useState } from "react";
import { getAllProducts } from "../../services/dashboardService";
import './ProductTable.css';
export default function ProductTable() {
  const [products, setProducts] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState(null);

  useEffect(() => {
    getAllProducts().then(data => {
      const processed = data.map((item, index) => ({
        ...item,
        even: index % 2 === 0,
        price: `${item.price}đ`,
        time: item.posted || "Đăng chưa rõ thời gian",
      }));
      setProducts(processed);
    });
  }, []);

  const handleViewMore = (product) => {
    setSelectedProduct(product);
  };

  const handleViewAll = () => {
    // hiển thị box với thông tin giả định hoặc gộp tất cả
    setSelectedProduct({ name: "Tất cả sản phẩm", type: "", price: "", time: "", description: "Đang hiển thị toàn bộ sản phẩm." });
  };

  return (
    <div className="jobs">
      <h2>
        Sản Phẩm{" "}
        <small
          style={{ cursor: "pointer", color: "#007bff" }}
          onClick={handleViewAll}
        >
          Xem tất cả sản phẩm <span className="las la-arrow-right"></span>
        </small>
      </h2>
      <div className="table-responsive">
        <table width="100%">
          <tbody>
            {products.map((product, idx) => (
              <tr key={idx}>
                <td>
                  <div>
                    <span className={`indicator ${product.even ? "even" : ""}`}></span>
                  </div>
                </td>
                <td><div>{product.name}</div></td>
                <td><div>{product.price}</div></td>
                <td><div>{product.type}</div></td>
                <td><div>{product.time}</div></td>
                <td>
                  <div>
                    <button onClick={() => handleViewMore(product)}>Xem thêm</button>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {selectedProduct && (
        <div style={{
          marginTop: "20px",
          padding: "20px",
          border: "1px solid #ccc",
          borderRadius: "8px",
          backgroundColor: "#f9f9f9"
        }}>
          <h3>Chi tiết sản phẩm</h3>
          <p><strong>Tên:</strong> {selectedProduct.name}</p>
          <p><strong>Loại:</strong> {selectedProduct.type}</p>
          <p><strong>Giá:</strong> {selectedProduct.price}</p>
          <p><strong>Thời gian:</strong> {selectedProduct.time}</p>
          <p><strong>Mô tả:</strong> {selectedProduct.description || "Không có mô tả."}</p>
          <button onClick={() => setSelectedProduct(null)}>Đóng</button>
        </div>
      )}
    </div>
  );
}
